          definition: 数据质量度量得到的一个值或一组值，或者将获取一个值或一组值同规定的一致性质量级别相比较得到的评价结果。
          entry_status: retired
          examples:
          - 数据质量元素及其数据质量子元素“完整性，多余错误”的数据质量评价结果为“90”、数据质量值类型为“百分比”是对数据质量范围指定数据进行数据质量度量而得到的示例。数据质量评价结果为“真”、数据质量值类型为“布尔型变量”是将值（90）同规定的一致性质量等级（85）相比较的示例，评价结果为良好、合格或不合格。
